pragma solidity ^0.4.18; 


contract ERC {
  
  function approve(address _to, uint256 _tokenId) public;
  function balanceOf(address _owner) public view returns (uint256 balance);
  function implementERC() public pure returns (bool);
  function ownerOf(uint256 _tokenId) public view returns (address addr);
  function takeOwnership(uint256 _tokenId) public;
  function totalSupply() public view returns (uint256 total);
  function transferFrom(address _from, address _to, uint256 _tokenId) public;
  function transfer(address _to, uint256 _tokenId) public;

  event Transfer(address indexed from, address indexed to, uint256 tokenId);
  event Approval(address indexed owner, address indexed approved, uint256 tokenId);
  }


contract CryptoDog is ERC {

  event Birth(uint256 tokenId, string name, address owner);
  
  event TokenSold(uint256 tokenId, uint256 oldPrice, uint256 newPrice, address prevOwner, address winner, string name);

  event Transfer(address from, address to, uint256 tokenId);

  string public constant NAME = "CryptoDogz"; 
  string public constant SYMBOL = "DogzToken";

  uint256 private startingPrice = 0.001 ether;
  uint256 private constant PROMO_CREATION_LIMIT = 5000;
  uint256 private firstStepLimit =  0.053613 ether;
  uint256 private secondStepLimit = 0.564957 ether;


  mapping (uint256 => address) public DogIndexToOwner;

  mapping (address => uint256) private ownershipTokenCount;

  mapping (uint256 => address) public DogIndexToApproved;

  mapping (uint256 => uint256) private DogIndexToPrice;

  address public ceoAddress;
  address public cooAddress;

  uint256 public promoCreatedCount;


  struct Dog {
    string name;
  }

  Dog[] private dogs;

  modifier onlyCEO() {
    require(msg.sender == ceoAddress);
    _;
  }

  modifier onlyCOO() {
    require(msg.sender == cooAddress);
    _;
  }

  modifier onlyCLevel() {
    require(
      msg.sender == ceoAddress ||
      msg.sender == cooAddress
    );
    _;
  }

  function DogToken() public {
    ceoAddress = msg.sender;
    cooAddress = msg.sender;
  }

  function approve(
    address _to,
    uint256 _tokenId
  ) public {
   
    require(_owns(msg.sender, _tokenId));

    DogIndexToApproved[_tokenId] = _to;

    emit Approval(msg.sender, _to, _tokenId);
  }

  function balanceOf(address _owner) public view returns (uint256 balance) {
    return ownershipTokenCount[_owner];
  }

  function createPromoDog(string _name, address _owner,  uint256 _price) public onlyCOO {
    require(promoCreatedCount < PROMO_CREATION_LIMIT);

    address dogOwner = _owner;
    if (dogOwner == address(0)) {
      dogOwner = cooAddress;
    }

    if (_price <= 0) {
      _price = startingPrice;
    }

    promoCreatedCount++;
    _createDog(_name, dogOwner, _price);
  }

  function createContractDog(string _name) public onlyCOO {
    _createDog(_name, address(this), startingPrice);
  }

  function getDog(uint256 _tokenId) public view returns (
    string dogName,
    uint256 sellingPrice,
    address owner
  ) {
    Dog storage dog = dogs[_tokenId];
    dogName = dog.name;
    sellingPrice = DogIndexToPrice[_tokenId];
    owner = DogIndexToOwner[_tokenId];
  }

  function implementERC() public pure returns (bool) {
    return true;
  }

  function name() public pure returns (string) {
    return NAME;
  }

  function ownerOf(uint256 _tokenId)
    public
    view
    returns (address owner)
  {
    owner = DogIndexToOwner[_tokenId];
    require(owner != address(0));
  }

  function payout(address _to) public onlyCLevel {
    _payout(_to);
  }

  function purchase(uint256 _tokenId) public payable {
    address oldOwner = DogIndexToOwner[_tokenId];
    address newOwner = msg.sender;

    uint256 sellingPrice = DogIndexToPrice[_tokenId];

    require(oldOwner != newOwner);

    require(_addressNotNull(newOwner));

    require(msg.value >= sellingPrice);

    uint256 payment = uint256(SafeMath.div(SafeMath.mul(sellingPrice, 94), 100));
    uint256 purchaseExcess = SafeMath.sub(msg.value, sellingPrice);

    if (sellingPrice < firstStepLimit) {
    
      DogIndexToPrice[_tokenId] = SafeMath.div(SafeMath.mul(sellingPrice, 200), 94);
    } else if (sellingPrice < secondStepLimit) {
    
      DogIndexToPrice[_tokenId] = SafeMath.div(SafeMath.mul(sellingPrice, 120), 94);
    } else {
    
      DogIndexToPrice[_tokenId] = SafeMath.div(SafeMath.mul(sellingPrice, 115), 94);
    }

    _transfer(oldOwner, newOwner, _tokenId);

    if (oldOwner != address(this)) {
      oldOwner.transfer(payment); 
    }

    emit TokenSold(_tokenId, sellingPrice, DogIndexToPrice[_tokenId], oldOwner, newOwner, dogs[_tokenId].name);

    msg.sender.transfer(purchaseExcess);
  }

  function priceOf(uint256 _tokenId) public view returns (uint256 price) {
    return DogIndexToPrice[_tokenId];
  }

  function setCEO(address _newCEO) public onlyCEO {
    require(_newCEO != address(0));

    ceoAddress = _newCEO;
  }

  function setCOO(address _newCOO) public onlyCEO {
    require(_newCOO != address(0));

    cooAddress = _newCOO;
  }

  
  function symbol() public pure returns (string) {
    return SYMBOL;
  }


  function takeOwnership(uint256 _tokenId) public {
    address newOwner = msg.sender;
    address oldOwner = DogIndexToOwner[_tokenId];


    require(_addressNotNull(newOwner));

    require(_approved(newOwner, _tokenId));

    _transfer(oldOwner, newOwner, _tokenId);
  }

  function tokensOfOwner(address _owner) public view returns(uint256[] ownerTokens) {
    uint256 tokenCount = balanceOf(_owner);
    if (tokenCount == 0) {
        
      return new uint256[](0);
    } else {
      uint256[] memory result = new uint256[](tokenCount);
      uint256 totalDogs = totalSupply();
      uint256 resultIndex = 0;

      uint256 dogId;
      for (dogId = 0; dogId <= totalDogs; dogId++) {
        if (DogIndexToOwner[dogId] == _owner) {
          result[resultIndex] = dogId;
          resultIndex++;
        }
      }
      return result;
    }
  }


  function totalSupply() public view returns (uint256 total) {
    return dogs.length;
  }


  function transfer(
    address _to,
    uint256 _tokenId
  ) public {
    require(_owns(msg.sender, _tokenId));
    require(_addressNotNull(_to));

    _transfer(msg.sender, _to, _tokenId);
  }

  function transferFrom(
    address _from,
    address _to,
    uint256 _tokenId
  ) public {
    require(_owns(_from, _tokenId));
    require(_approved(_to, _tokenId));
    require(_addressNotNull(_to));

    _transfer(_from, _to, _tokenId);
  }

  function _addressNotNull(address _to) private pure returns (bool) {
    return _to != address(0);
  }


  function _approved(address _to, uint256 _tokenId) private view returns (bool) {
    return DogIndexToApproved[_tokenId] == _to;
  }


  function _createDog(string _name, address _owner, uint256 _price) private {
    Dog memory _dog = Dog({
      name: _name
    });
    uint256 newDogId = dogs.push(_dog) - 1;

    require(newDogId == uint256(uint32(newDogId)));

    emit Birth(newDogId, _name, _owner);

    DogIndexToPrice[newDogId] = _price;


    _transfer(address(0), _owner, newDogId);
  }

 
  function _owns(address claimant, uint256 _tokenId) private view returns (bool) {
    return claimant == DogIndexToOwner[_tokenId];
  }


  function _payout(address _to) private {
    if (_to == address(0)) {
      ceoAddress.transfer(address(this).balance);
    } else {
      _to.transfer(address(this).balance);
    }
  }


  function _transfer(address _from, address _to, uint256 _tokenId) private {
    
    ownershipTokenCount[_to]++;
  
    DogIndexToOwner[_tokenId] = _to;


    if (_from != address(0)) {
      ownershipTokenCount[_from]--;
      delete DogIndexToApproved[_tokenId];
    }

    emit Transfer(_from, _to, _tokenId);
  }
}
library SafeMath {

  function mul(uint256 a, uint256 b) internal pure returns (uint256) {
    if (a == 0) {
      return 0;
    }
    uint256 c = a * b;
    assert(c / a == b);
    return c;
  }

  function div(uint256 a, uint256 b) internal pure returns (uint256) {
    uint256 c = a / b;
    return c;
  }

  function sub(uint256 a, uint256 b) internal pure returns (uint256) {
    assert(b <= a);
    return a - b;
  }

  function add(uint256 a, uint256 b) internal pure returns (uint256) {
    uint256 c = a + b;
    assert(c >= a);
    return c;
  }
}
